INSERT INTO `fa_query` VALUES (1,'查询管理模板','query',1,10,1,1,1,0,'SELECT ID id,NAME,CODE,AUTO_LOAD,PAGE_SIZE ,SHOW_CHECKBOX,IS_DEBUG,FILTR_LEVEL ,REMARK ,NEW_DATA \nFROM fa_query','{\n	\"ID\": {\n		\"title\": \"查询ID\",\n		\"type\": \"number\",\n		\"editable\": false\n	},\n	\"NAME\": {\n		\"title\": \"查询名\",\n		\"tooltip\": \"用于查询\",\n		\"type\": \"string\"\n	},\n	\"CODE\": {\n		\"title\": \"代码\",\n		\"type\": \"string\"\n	},\n	\"AUTO_LOAD\": {\n		\"title\": \"自动加载\",\n		\"defaultValue\": 1,\n		\"type\": \"custom\",\n		\"renderComponent\": \"SmartTableFormatValuePage\",\n		\"onComponentInitFunction\": function(instance) {\n			instance.format = (x) => {\n				return x == 0 ? \"否\" : \"是\"\n			}\n		},\n		\"editor\": {\n			\"type\": \"list\",\n			\"config\": {\n				\"list\": [{\n						\"value\": \"1\",\n						\"title\": \"是\"\n					},\n					{\n						\"value\": \"0\",\n						\"title\": \"否\"\n					}\n				]\n			}\n		}\n	},\n	\"PAGE_SIZE\": {\n		\"title\": \"页面大小\",\n		\"type\": \"number\",\n		\"defaultValue\": 10\n	},\n	\"SHOW_CHECKBOX\": {\n		\"title\": \"允许多选\",\n		\"type\": \"custom\",\n		\"renderComponent\": \"SmartTableFormatValuePage\",\n		\"onComponentInitFunction\": function(instance) {\n			instance.format = (x) => {\n				return x == 0 ? \"否\" : \"是\"\n			}\n		},\n		\"defaultValue\": 1,\n		\"editor\": {\n			\"type\": \"list\",\n			\"config\": {\n				\"list\": [{\n						\"value\": \"1\",\n						\"title\": \"是\"\n					},\n					{\n						\"value\": \"0\",\n						\"title\": \"否\"\n					}\n				]\n			}\n		}\n	},\n	\"IS_DEBUG\": {\n		\"title\": \"是否隐藏\",\n		\"editable\": false,\n		\"type\": \"custom\",\n		\"renderComponent\": \"SmartTableFormatValuePage\",\n		\"onComponentInitFunction\": function(instance) {\n			instance.format = (x) => {\n				return x == 0 ? \"否\" : \"是\"\n			}\n		},\n		\"defaultValue\": 1,\n		\"editor\": {\n			\"type\": \"list\",\n			\"config\": {\n				\"list\": [{\n						\"value\": \"1\",\n						\"title\": \"是\"\n					},\n					{\n						\"value\": \"0\",\n						\"title\": \"否\"\n					}\n				]\n			}\n		}\n	},\n	\"FILTR_LEVEL\": {\n		\"title\": \"过滤层级\",\n		\"editable\": false,\n		\"type\": \"number\",\n		\"defaultValue\": 1\n	},\n	\"DESKTOP_ROLE\": {\n		\"title\": \"是否首页显示\",\n		\"editable\": false,\n		\"type\": \"string\"\n	},\n	\"NEW_DATA\": {\n		\"title\": \"输入的时间\",\n		\"editable\": false,\n		\"type\": \"string\"\n	},\n	\"QUERY_CONF\": {\n		\"title\": \"查询脚本\",\n		\"tooltip\": \"能查出数据的SQL\",\n		\"type\": \"string\",\n		\"inputWidth\": 12,\n		\"isTabs\": true,\n		\"hide\": true,\n		\"editor\": {\n			\"type\": \"textarea\"\n		}\n	},\n	\"QUERY_CFG_JSON\": {\n		\"title\": \"列配置信息\",\n		\"tooltip\": \"title:标题,type:类型,inputWidth:列宽(6/12),editable:是否可编辑,editor:编辑配置,isTabs:tabs显示,tooltip:编辑框提示,hide:是否在列表显示\",\n		\"type\": \"string\",\n		\"isTabs\": true,\n		\"hide\": true,\n		\"inputWidth\": 12,\n		\"editor\": {\n			\"type\": \"textarea\"\n		}\n	},\n\n	\"IN_PARA_JSON\": {\n		\"title\": \"传入的参数\",\n		\"type\": \"string\",\n		\"isTabs\": true,\n		\"hide\": true,\n		\"inputWidth\": 12,\n		\"editor\": {\n			\"type\": \"textarea\"\n		}\n	},\n	\"JS_STR\": {\n		\"title\": \"JS脚本\",\n		\"type\": \"string\",\n		\"isTabs\": true,\n		\"hide\": true,\n		\"inputWidth\": 12,\n		\"editor\": {\n			\"type\": \"textarea\"\n		}\n	},\n	\"ROWS_BTN\": {\n		\"title\": \"行按钮\",\n		\"tooltip\": \"目前只支持两个按钮，一个修改，一个删除\",\n		\"isTabs\": true,\n		\"hide\": true,\n		\"type\": \"string\"\n	},\n	\"HEARD_BTN\": {\n		\"title\": \"表头按钮\",\n        \"tooltip\": \"添加事件：nowThis.Add(\'api地址\');批量执行：nowThis.exec(\'api地址\',\'列名\',\'确认提示信息\')；导出所有事件：nowThis.onExportXls()\",\n		\"isTabs\": true,\n		\"hide\": true,\n		\"type\": \"string\"\n	},\n\n	\"REMARK\": {\n		\"title\": \"备注\",\n		\"isTabs\": true,\n		\"hide\": true,\n		\"type\": \"string\",\n		\"inputWidth\": 12,\n		\"editor\": {\n			\"type\": \"textarea\"\n		}\n	}\n}',NULL,NULL,'[{\n		\"title\": \"修改\",\n		\"class\": \"nb-edit\",\n		\"apiUrl\": \"query/save\"\n	},\n	{\n		\"title\": \"删除\",\n		\"class\": \"nb-trash\",\n		\"apiUrl\": \"query/delete\",\n		\"confirmTip\": \"确定要删除吗？\"\n	}\n]','[\n  {\n    \"title\":\"添加\",\n    \"class\":\"nb-plus\",\n    \"click\":\"nowThis.Add(\'query/save\')\"\n  },\n  {\n    \"title\":\"导出\",\n    \"class\":\"ion-archive\",\n    \"click\":\"nowThis.onExportXls()\"\n  }\n  ,\n  {\n    \"title\":\"设置\",\n    \"class\":\"nb-gea\"\n  }\n]\n',NULL,NULL,'\'\'',NULL,'可以管理系统的模块1',NULL),(2,'查询用户','user',1,10,1,1,1,0,'SELECT\n  ID id,\n  NAME name,\n  LOGIN_NAME loginName,\n  ICON_FILES iconFiles,\n  DISTRICT_ID districtId,\n  IS_LOCKED isLocked,\n  CREATE_TIME createTime,\n  LOGIN_COUNT loginCount,\n  LAST_LOGIN_TIME lastLoginTime,\n  LAST_LOGOUT_TIME lastLogoutTime,\n  LAST_ACTIVE_TIME lastActiveTime,\n  REMARK remark,\n (\n		SELECT\n			group_concat(b.`NAME`)\n		FROM\n			fa_role b,\n			fa_user_role c\n		WHERE\n			b.ID = c.ROLE_ID\n		AND c.USER_ID = a.ID\n	) roleIdList\nFROM\n	fa_user a','{\n    \"id\": {\n        \"title\": \"ID\",\n        \"type\": \"int\",\n        \"editable\": false,\n        \"filterAble\": false\n    },\n    \"name\": {\n        \"title\": \"姓名\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"loginName\": {\n        \"title\": \"登录名\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"districtId\": {\n        \"title\": \"归属地\",\n        \"type\": \"int\",\n        \"editable\": true\n    },\n    \"roleIdList\": {\n        \"title\": \"角色\",\n        \"type\": \"string\",\n        \"editable\": true,\n        \"editor\": {\n            \"type\": \"listAsyn\",\n            \"config\": {\n                \"api\": \"user/query/getListData\",\n                \"multiple\": true,\n                \"postEnt\": {\n                    \"code\": \"role\"\n                },\n                \"hasAllCheckBox\": false,\n                \"maxHeight\": 100\n            }\n        },\n        \"filter\": {\n            \"type\": \"listAsyn\",\n            \"config\": {\n                \"api\": \"user/query/getListData\",\n                \"postEnt\": {\n                    \"code\": \"role\"\n                }\n            }\n        }\n    },\n    \"iconFiles\": {\n        \"title\": \"头像图片\",\n        \"type\": \"int\",\n        \"editable\": true,\n        \"hide\": true,\n        \"filterable\": false,\n        \"editor\": {\n            \"type\": \"file\"\n        }\n    },\n\n    \"createTime\": {\n        \"title\": \"创建时间\",\n        \"type\": \"Date\",\n        \"editable\": false,\n        \"editor\": {\n            \"type\": \"Date\",\n            \"bsConfig\": {\n                \"dateInputFormat\": \"YYYY-MM-DD\",\n                \"containerClass\": \"theme-red\"\n            }\n        },\n        \"filter\": {\n            \"type\": \"Date\",\n            \"range\": true,\n            \"bsConfig\": {\n                \"dateInputFormat\": \"YYYY-MM-DD\",\n                \"containerClass\": \"theme-red\"\n            }\n        }\n    },\n    \"loginCount\": {\n        \"title\": \"登录次数\",\n        \"type\": \"int\",\n        \"editable\": false\n    },\n    \"lastLoginTime\": {\n        \"title\": \"最后登录时间\",\n        \"editable\": false,\n        \"type\": \"Date\",\n        \"editor\": {\n            \"type\": \"Date\",\n            \"bsConfig\": {\n                \"dateInputFormat\": \"YYYY-MM-DD\",\n                \"containerClass\": \"theme-red\"\n            }\n        }\n    },\n    \"lastLogoutTime\": {\n        \"title\": \"最后离开时间\",\n        \"type\": \"Date\",\n        \"editable\": false,\n        \"editor\": {\n            \"type\": \"Date\",\n            \"bsConfig\": {\n                \"dateInputFormat\": \"YYYY-MM-DD\",\n                \"containerClass\": \"theme-red\"\n            }\n        }\n    },\n    \"lastActiveTime\": {\n        \"title\": \"最后活动时间\",\n        \"type\": \"Date\",\n        \"editable\": false,\n        \"editor\": {\n            \"type\": \"Date\",\n            \"bsConfig\": {\n                \"dateInputFormat\": \"YYYY-MM-DD\",\n                \"containerClass\": \"theme-red\"\n            }\n        }\n    },\n    \"remark\": {\n        \"title\": \"备注\",\n        \"type\": \"String\",\n        \"editable\": true,\n        \"editor\": {\n            \"type\": \"textarea\"\n        }\n    },\n    \"isLocked\": {\n        \"title\": \"锁定\",\n        \"type\": \"String\",\n        \"editable\": true,\n        \"valuePrepareFunction\": (v) => { return v == 1 ? \'是\' : \'否\' },\n        \"editor\": {\n            \"type\": \"list\",\n            \"config\": {\n                \"list\": [\n                    {\n                        \"value\": \"1\",\n                        \"title\": \"是\"\n                    },\n                    {\n                        \"value\": \"0\",\n                        \"title\": \"否\"\n                    }\n                ]\n            }\n        }\n    }\n}',NULL,NULL,'[{\n		\"title\": \"修改\",\n		\"class\": \"nb-edit\",\n		\"apiUrl\": \"user/user/save\",\n		\"readUrl\": \"user/user/singleByKey\"\n	},\n	{\n		\"title\": \"删除\",\n		\"class\": \"nb-trash\",\n		\"apiUrl\": \"user/user/delete\",\n		\"confirmTip\": \"确定要删除该用户吗？\"\n	}\n]','[\n    {\n        \"title\": \"添加\",\n        \"class\": \"nb-plus\",\n        \"click\": \"nowThis.Add(\'user/user/save\')\"\n    }\n]',NULL,NULL,'\'\'',NULL,'用户的基本情况管理',NULL),(3,'脚本管理','script',1,10,0,0,1,0,'select \n  ID id,\n  CODE code,\n  NAME name,\n  BODY_TEXT bodyText,\n  BODY_HASH bodyHash,\n  RUN_WHEN runWhen,\n  RUN_ARGS runArgs,\n  RUN_DATA runData,\n  STATUS status,\n  DISABLE_REASON disableReason,\n  SERVICE_FLAG serviceFlag,\n  REGION region,\n  IS_GROUP isGroup \nfrom FA_SCRIPT','{\n    \"id\": {\n        \"title\": \"ID\",\n        \"type\": \"int\",\n        \"editable\": false\n    },\n    \"code\": {\n        \"title\": \"代码\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"name\": {\n        \"title\": \"名称\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"runWhen\": {\n        \"title\": \"时间表达式\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"bodyText\": {\n        \"title\": \"任务脚本\",\n        \"type\": \"String\",\n        \"editable\": true,\n        \"editor\": {\n            \"type\": \"textarea\"\n        },\n        \"style\":\"col-md-12\"\n    },\n\n    \"runArgs\": {\n        \"title\": \"脚本参数\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"status\": {\n        \"title\": \"状态\",\n        \"type\": \"checkbox\",\n        \"editable\": true,\n        \"editor\": {\n            \"type\": \"checkbox\"\n        },\n        \"valuePrepareFunction\": (v) => { return v == 1 ? \'是\' : \'否\' },\n        \"editor\": {\n            \"type\": \"list\",\n            \"config\": {\n                \"list\": [\n                    {\n                        \"value\": \"1\",\n                        \"title\": \"是\"\n                    },\n                    {\n                        \"value\": \"0\",\n                        \"title\": \"否\"\n                    }\n                ]\n            }\n        }\n    },\n    \"disableReason\": {\n        \"title\": \"禁用原因\",\n        \"type\": \"String\",\n        \"editable\": true,\n        \"style\":\"col-md-12\"\n    }\n}',NULL,NULL,'[{\n		\"title\": \"修改\",\n		\"class\": \"nb-edit\",\n		\"apiUrl\": \"quartz/script/save\",\n		\"readUrl\": \"quartz/script/singleByKey\"\n	},\n	{\n		\"title\": \"删除\",\n		\"class\": \"nb-trash\",\n		\"apiUrl\": \"quartz/script/delete\",\n		\"confirmTip\": \"确定要删除该用户吗？\"\n	}\n]','[\n    {\n        \"title\": \"添加\",\n        \"class\": \"nb-plus\",\n        \"click\": \"nowThis.Add(\'quartz/script/save\')\"\n    }\n]',NULL,NULL,'\'\'',NULL,'脚本管理',NULL),(4,'自定义表','tableType',1,10,1,1,1,0,'select \n  ID id,\n  NAME name,\n  TABLE_NAME tableName,\n  INTRODUCE introduce,\n  ADD_TIME addTime,\n  STAUTS stauts \nfrom fa_table_type',