tion,\r\n  IMAGE_URL imageUrl,\r\n  DESKTOP_ROLE desktopRole,\r\n  W w,\r\n  H h \r\nfrom FA_MODULE','{\n    \"id\": {\n        \"title\": \"ID\",\n        \"type\": \"int\",\n        \"editable\": false\n    },\n    \"parentId\": {\n        \"title\": \"上级\",\n        \"type\": \"int\",\n        \"editable\": true,\n        \"editor\": {\n            \"type\": \"listTreeAsyn\",\n            \"config\": {\n                \"api\": \"user/query/getListData\",\n                \"postEnt\": {\n                    \"code\": \"module\",\n                    \"page\": 1,\n                    \"rows\": 20\n                },\n                \"TreeOptions\": {\n                    \"useCheckbox\": false,\n                    \"childrenField\": \"children\",\n                    \"displayField\": \"name\",\n                    \"idField\": \"id\"\n                },\n                \"hasAllCheckBox\": false,\n                \"maxHeight\": 100\n            }\n        }\n    },\n    \"name\": {\n        \"title\": \"模块名\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"location\": {\n        \"title\": \"地址\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"code\": {\n        \"title\": \"代码\",\n        \"type\": \"String\",\n        \"editable\": true\n    },\n    \"isDebug\": {\n        \"title\": \"调试\",\n        \"type\": \"checkbox\",\n        \"valuePrepareFunction\": (v) => { return v == 1 ? \'是\' : \'否\' },\n        \"editable\": true,\n        \"editor\": {\n            \"type\": \"checkbox\"\n        },\n        \"filter\": {\n            \"type\": \"checkbox\",\n            \"config\": {\n                \"true\": \"Yes\",\n                \"false\": \"No\",\n                \"resetText\": \"clear\"\n            }\n        }\n    },\n    \"isHide\": {\n        \"title\": \"隐藏\",\n        \"type\": \"String\",\n        \"editable\": true,\n        \"valuePrepareFunction\": (v) => { return v == 1 ? \'是\' : \'否\' 